Synopsis
Chirammal Enashu Francis, a.k.a. Pranchiyettan (Mammootty), is a successful businessman based in Thrissur. He is a devotee of Saint Francis of Assisi and often has imaginary conversations with the saint. His ancestors were rice traders, but he has grown beyond the small rice shop to expand his business into jewellery, real estate, finance, shopping complexes and lot more. Even though he is successful and wealthy, he is not well-educated (He has not cleared the SSLC exams), is unhappy with his name and also wants to become a celebrity. He is called Ari (&quot;rice&quot;) Pranchi by everybody, citing his ancestors' business as a colloquial taunt. He wants to change his image from Ari Pranchi to something great and is ready to spend a fortune for it. The film deals with how Pranchi tries to get a good name and what changes that brings to his life.


